import React, { Fragment } from "react"
import {navData} from "../router/index"
import {NavLink} from "react-router-dom"
function Nav(){
    return(
        <Fragment>
            navData.map((item,index)=>{
                <NavLink
                    to={item.path}
                    key={index}
                >{item.title}</NavLink>
            })
        </Fragment>
        
    )
}

export default Nav;
